nombresDeUsuarios :: RedSocial -> Set String
nombresDeUsuarios ([],_,_) = []
nombresDeUsuarios ((u:us), rs, ps) = elimRepetidos (nombreDeUsuario u : nombresDeUsuarios (us,rs,ps))


-- Dada una red social y un usuario retorna el conjunto de amigos del mismo
amigosDe :: RedSocial -> Usuario -> Set Usuario
amigosDe ([],_,_) user = []
amigosDe ((u:us),rs,ps) user | u == user = relacionesDe rs user
                             | otherwise = amigosDe (us,rs,ps) user

--Busco las relaciones de 1 usuarios
relacionesDe :: Set Relacion -> Usuario -> Set Usuario
relacionesDe [] user = []
relacionesDe ((user1,user2):rs) user | user == user1 = user2:relacionesDe rs user
                                     | user == user2 = user1:relacionesDe rs user
                                     | otherwise = relacionesDe rs user

-- Dada una red social y un usuario retorna la cantidad de amigos de dicho usuario
cantidadDeAmigos :: RedSocial -> Usuario -> Int
cantidadDeAmigos ((u:us),rs,ps) user | u == user = cantidadRelaciones rs user
                                     | otherwise = cantidadDeAmigos (us,rs,ps) user

cantidadRelaciones :: Set Relacion -> Usuario -> Int
cantidadRelaciones [] user = 0
cantidadRelaciones ((user1,user2):rs) user | user == user1 = 1 + cantidadRelaciones rs user
                                           | user == user2 = 1 + cantidadRelaciones rs user
                                           | otherwise = cantidadRelaciones rs user

-- Dada una red social retorna el usuario con mas amigos. De existir más de uno devuelve cualquiera de ellos.
usuarioConMasAmigos :: RedSocial -> Usuario
usuarioConMasAmigos ((u:[]),_,_) = u
usuarioConMasAmigos ((u1:u2:us),rs,ps) | (cantidadDeAmigos ((u1:u2:us),rs,ps) u1) >= (cantidadDeAmigos ((u1:u2:us),rs,ps) u2) = usuarioConMasAmigos ((u1:us),rs,ps)
                                       | otherwise = usuarioConMasAmigos ((u2:us),rs,ps)

-- Dada una red social retorna True si algún usuario tiene más de un millón de amigos
estaRobertoCarlos :: RedSocial -> Bool
estaRobertoCarlos red | ( cantidadDeAmigos red (usuarioConMasAmigos red) ) > 3 = True
                      | otherwise = False

-- Dada una red social y un usuario retorna el conjunto de publicaciones del mismo.
publicacionesDe :: RedSocial -> Usuario -> Set Publicacion
publicacionesDe (_,[],_) user = []
publicacionesDe ((u:us),rs,ps) user | u == user = pubDe ps user
                                    | otherwise = publicacionesDe (us,rs,ps) user

pubDe :: Set Publicacion -> Usuario -> Set Publicacion
pubDe [] user = []
pubDe ((us,texto,lista_users):ps) user | us == user = (us,texto,lista_users):pubDe ps user
                                       | otherwise = pubDe ps user

-- Dada una red social y un usuario retorna el conjunto de publicaciones a las que el usuario les dió like.
publicacionesQueLeGustanA :: RedSocial -> Usuario -> Set Publicacion
publicacionesQueLeGustanA (us,rs,[]) user = []
publicacionesQueLeGustanA (us,rs,(p:ps)) user | matchPublicacionUsuario p user = (p:publicacionesQueLeGustanA (us,rs,ps) user)
                                           | otherwise = publicacionesQueLeGustanA (us,rs,ps) user

matchPublicacionUsuario :: Publicacion -> Usuario -> Bool
matchPublicacionUsuario (_,_,[]) user = False
matchPublicacionUsuario (publicador,post,(u:us)) user | u == user = True
                                          | otherwise = matchPublicacionUsuario (publicador,post,us) user

-- Dada una red social y dos usuarios indica si les gustan las mismas publicaciones
lesGustanLasMismasPublicaciones :: RedSocial -> Usuario -> Usuario -> Bool
lesGustanLasMismasPublicaciones rs us1 us2 | publicacionesQueLeGustanA rs us1 == publicacionesQueLeGustanA rs us2 = True
                                           | otherwise = False

-- Dada una red social y un usuario u, indica si existe un usuario que le puso like a todas las publicaciones de u.
tieneUnSeguidorFiel :: RedSocial -> Usuario -> Bool
tieneUnSeguidorFiel ([],_,_) user = False
tieneUnSeguidorFiel ((u:us),rs,ps) user | checkUsuarioPublicacion (publicacionesDe ((u:us),rs,ps) user) u == length (publicacionesDe ((u:us),rs,ps) user) =  True
                                        | otherwise = tieneUnSeguidorFiel (us,rs,ps) user

checkUsuarioPublicacion :: Set Publicacion -> Usuario -> Int
checkUsuarioPublicacion [] user = 0
checkUsuarioPublicacion (p:ps) user | matchPublicacionUsuario p user == True = 1 + checkUsuarioPublicacion ps user
                                    | otherwise = checkUsuarioPublicacion ps user

