-- Dada una lista de cierto tipo retorna un conjunto del mismo tipo
elimRepetidos :: Eq a => [a] -> Set a
elimRepetidos (a:as)
 | as == [] = [a]
 | (elem a as) = elimRepetidos as
 | otherwise = a : (elimRepetidos as)
